import React, { Component } from 'react';
import BasePage from '../BasePages/BasePage.js';
import Search from '../../components/ProfileBlocks/Search/Search.js';
import ProfileBlocksSecretary from '../../components/ProfileBlocks/Secretary/ProfileBlocksSecretary/ProfileBlocksSecretary.jsx';
import axios from 'axios';

class ProfileSecretary extends Component {
  constructor(props) {
    super(props);
    console.log('Constructor called');
    this.state = {
      secretaryData: [],
    };
  }

   componentDidMount() {
    console.log('componentDidMount called');
    try {
      const token = localStorage.getItem('token');
      console.log('token', token);
      if (token) {
        axios.get('http://127.0.0.1:8000/v1/main/secretary/profile/', {
          headers: {
            Authorization: `Token ${token}`, // Устанавливаем заголовок авторизации с токеном
          },
        })
        .then((res) => {
          console.log('Data fetched successfully:', res.data); // Вывод полученных данных в консоль
          this.setState({
            secretaryData: res.data,
          }, () => {
            console.log('State updated:', this.state.secretaryData); // Проверка обновленного состояния
          });
        })
        .catch((err) => {
          console.error('Error fetching data:', err); // Вывод ошибки в консоль
        });
      } else {
        console.log('No token found in localStorage');
      }
    } catch (error) {
      console.error('Error in componentDidMount:', error);
    }
  }

  render() {
    const { secretaryData } = this.state;
    console.log('render method called');
    console.log('secretaryData in render:', secretaryData);
    return (
      <BasePage isAuthenticated={true} data={secretaryData}>
        <Search />
        <ProfileBlocksSecretary secretaryData={secretaryData} />
      </BasePage>
    );
  }
}

export default ProfileSecretary;
